import React, { Component } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import 'bootstrap/dist/css/bootstrap.min.css';

import image1 from './Images/image1.jpg';
import image2 from './Images/image2.jpg';
import image3 from './Images/image3.jpg';
import image4 from './Images/image4.jpg';
import './LocalDetails.css';

class LocalDetails extends Component {
    constructor(props) {
        super(props);
        this.state = {
            arrivalDate: null,
            departureDate: null,
            local: null
        };
    }

    componentDidMount() {
        const { id } = this.props.match.params;
        axios.get(`http://localhost:8080/Local/LocalDetails/${id}`)
            .then(response => {
                this.setState({ local: response.data });
            })
            .catch(error => {
                console.error('Error fetching Local:', error);
            });
    }

    render() {
        const { local, arrivalDate, departureDate } = this.state;
        const images = [image1, image2, image3, image4];

        return (
            <div className="container bg-light">
                <div className="row">
                    <div className="col-9">
                        <h1>{local ? local.name : 'Loading...'}</h1>
                    </div>
                    <div className="col-3">
                        <p>blassa dyal 7lima</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col-6">
                        <img className="m-1 img-fluid" src={images[0]} alt="Image 1" />
                    </div>
                    <div className="col-6">
                        <div className="row">
                            <div className="col-6">
                                <img className="m-1 img-fluid" src={images[0]} alt="Image 2" />
                            </div>
                            <div className="col-6">
                                <img className="m-1 img-fluid" src={images[1]} alt="Image 3" />
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-6">
                                <img className="m-1 img-fluid" src={images[2]} alt="Image 4" />
                            </div>
                            <div className="col-6">
                                <img className="m-1 img-fluid" src={images[3]} alt="Image 5" />
                            </div>
                        </div>
                    </div>
                </div>
                <div className="row">
                    <div className="col-6">
                        <div className="m-2">
                            <h3>Detail</h3>
                            <p>{local ? local.description : 'Loading...'}</p>
                        </div>
                    </div>
                    <div className="col-6">
                        <div className="card m-2">
                            <div className="card-body">
                                <h5 className="card-title">For reservation</h5>
                                <p> ghade deri hanaya dakchi li deja endk</p>
                                <p className="date-label">ARRIVÉE</p>
                                <DatePicker
                                    selected={arrivalDate}
                                    onChange={date => this.setState({ arrivalDate: date })}
                                    placeholderText="Select date"
                                />
                                <div className="booking-option">
                                    <p className="date-label">DÉPART</p>
                                    <DatePicker
                                        selected={departureDate}
                                        onChange={date => this.setState({ departureDate: date })}
                                        placeholderText="Select date"
                                    />
                                    <input className="row" />
                                    <input className="row" /><input className="row" /><input className="row" /><input className="row" />
                                    <button>Submit</button>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default LocalDetails;
